import react from 'react';

export default function SideBar(){
  let menu_items = ['Student Info','Registeration','Courses'];
    return(
        <div class = 'flex-col  place-content-center w-[12rem] bg-[#4455af] h-[95vh] sticky rounded-[1.2rem] m-[1.2rem]'>
          <div class='flex-col bg-transparent'>  
              <img src = 'https://placehold.co/600x600' class='w-[8rem] rounded-[1.2rem] inherit' />
              <p class='text-white text-center bg-transparent'>Dashboard</p >
          </div>
          <div class='flex-col bg-transparent'>
                  <ul class='bg-transparent'>
                    {menu_items.map((menuItem, index) => (
                        <li key={index} class='text-white bg-transparent'> {menuItem} </li>
                  ))}
        </ul>
          </div>
        </div>
    );
}
